// Message.js
import React from 'react';


const Chat = ({ messages }) => { // Receive messages from props

  return (
    <div id="message-container">
      {messages.map((message, index) => (
            <div key={index} className={`message ${message.role}`}>
              {message.content}
            </div>
          ))}
    </div>
  );
};


export default Chat;
